results.description:
wiStats is a Today Extension Widget that will show information about the currently connected WiFi network and run internet speed tests.

wiStats will quickly tell you your:

- Local IP;
- Network security;
- WiFi link speed;
- Signal strength;
- Download traffic stats;
- Upload traffic stats;
- Internet service provider;
- Real IP;
- Internet latency (PING);
- Download speed (bandwidth);
- Upload speed (bandwidth);
